import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import CardList from "./components/CardList";
import Gambar from "./assets/images/batik.png";
import Quotes from "./components/Quotes";
const quotes="Assalamualaikum";
const students = [
  {nama :'Dzakwan',nim:'123',kelompok:'1',image:'https://randomuser.me/api/portraits/men/23.jpg'},
  {nama :'Diego',nim:'234',kelompok:'3',image: 'https://randomuser.me/api/portraits/men/65.jpg'},
  ]

ReactDOM.render(
  <React.StrictMode>
    <App />
    {students.map((item,index)=>(
  <CardList id={index} name={item.nama} nim={item.nim} kelompok={item.kelompok} image={item.image} />
  ))
  }
    <Quotes author="Orang" quotes={quotes} />
  </React.StrictMode>,
  document.getElementById("root")
);
